#
# TABLE STRUCTURE FOR: job_offers
#

DROP TABLE IF EXISTS `job_offers`;

CREATE TABLE `job_offers` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `status` enum('open','closed') COLLATE utf8_unicode_ci DEFAULT NULL,
  `organisation_id` bigint(20) unsigned NOT NULL,
  `description` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `salary` int(11) DEFAULT NULL,
  `min_avg_mark` float(5,2) DEFAULT NULL,
  `min_experience` int(11) DEFAULT NULL,
  `min_age` int(11) DEFAULT NULL,
  `max_age` int(11) DEFAULT NULL,
  `published_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;



